7:37.604571","exception":false,"start_time":"2023-02-14T05:26:47.268693","status":"completed"},"tags":[]},"outputs":[],"source":["#==========manipulating and cleaning each month's data frame=============================\n","\n","#Adding ride duration\n","for(i in seq_along(mydf)){\n","  mydf[[i]] <- mydf[[i]] %>% mutate(ride_duration = ended_at - started_at)\n","}\n","\n","#Adding weekday from date\n","for(i in seq_along(mydf)){\n","  mydf[[i]] <- mydf[[i]] %>% mutate(weekday = wday(started_at, label=TRUE))\n","}\n","\n","#Filtering data to remove ride ids with characters != 16, ride duration <0 and also to remove all null values in the dataset\n","#and assigning it to a new data frame variable\n","mydf_final <- list()\n","for(i in seq_along(mydf)){\n","  mydf_final[[i]] <- mydf[[i]] %>% filter(nchar(ride_id) == 16 & ride_duration > 0) %>% drop_na()  \n","}\n","\n","#Combining monthly data frames to one single yearly data fram\n","mydf_final_yearly <- list()\n","for(i in seq_along(mydf_final)){\n","  mydf_final_yearly <- rbind(mydf_final_yearly, mydf_final[[i]]) \n","}\n","\n","#Cleaning station names with substrings \"&amp\" and \"Public Rack\"\n","mydf_final_yearly_2 <- mydf_final_yearly %>% mutate(start_station_name = str_replace(start_station_name,\"&amp;\",\"&\"))\n","mydf_final_yearly_2 <- mydf_final_yearly_2 %>% mutate(start_station_name = str_replace(start_station_name,\"Public Rack - \",\"\"),\n","                                                     end_station_name = str_replace(end_station_name,\"Public Rack - \",\"\")) \n","\n","#Adding column for month\n","mydf_final_yearly_2 <- mydf_final_yearly_2 %>% mutate(month = month(started_at, label = TRUE))"]},{"cell_type":"code","execution_count":4,"id":"11765d4d","metadata":{"execution":{"iopub.execute_input":"2023-02-14T05:27:37.623597Z","iopub.status.busy":"2023-02-14T05:27:37.622057Z","iopub.status.idle":"2023-02-14T05:27:38.295118Z","shell.execute_reply":"2023-02-14T05:27:38.293403Z"},"papermill":{"durati