es(xmin = 1, xmax = 2, ymin = ymin, ymax = ymax, fill = rideable_type)) + xlim(-1,2) +\n","  coord_polar(theta = \"y\") +\n","  theme_void() +\n","  geom_label(aes(x=1.5, y=ypos, label = paste(str_to_title(str_replace(rideable_type,\"_bike\",\"\")), \"\\n(\", round(count_of_rides/sum(count_of_rides)*100,1),\"%)\"), fill = rideable_type), color = \"white\", size = 6, hjust = -0.05) +\n","  labs(title = \"Share of Bike Types \\nfor Casual Riders\") +\n","  theme(legend.position = \"none\", plot.title = element_text(hjust = 0.5, vjust = -5, size = 35), text = element_text(family = \"Calibri Light\")) +\n","  scale_fill_manual(values = c(\"#0C6E7B\",\"#532b39\",\"#7d8513\"))\n","\n","st5 <- mydf_final_yearly %>% filter(member_casual == \"member\") %>% group_by(rideable_type) %>% summarize(count_of_rides = n())\n","st5 <- st5 %>% mutate(proportion = round(count_of_rides/sum(count_of_rides)*100,1))\n","st5 <- st5 %>% arrange(desc(rideable_type))\n","st5 <- st5 %>% mutate(ypos = cumsum(count_of_rides) - 0.5*count_of_rides)\n","st5 <- st5 %>% mutate(ymax = cumsum(count_of_rides), ymin = cumsum(count_of_rides)-count_of_rides)\n","ggplot(data = st5) + \n","  geom_rect(aes(xmin = 1, xmax = 2, ymin = ymin, ymax = ymax, fill = rideable_type)) + xlim(-1,2) +\n","  coord_polar(theta = \"y\") +\n","  theme_void() +\n","  geom_label(aes(x=1.5, y=ypos, label = paste(str_to_title(str_replace(rideable_type,\"_bike\",\"\")), \"\\n(\", round(count_of_rides/sum(count_of_rides)*100,1),\"%)\"), fill = rideable_type), color = \"white\", size = 6, hjust = -0.05) +\n","  labs(title = \"Share of Bike Types \\nfor Annual Members\") +\n","  theme(legend.position = \"none\", plot.title = element_text(hjust = 0.5, vjust = -5, size = 35), text = element_text(family = \"Calibri Light\")) +\n","  scale_fill_manual(values = c(\"#0C6E7B\",\"#7d8513\"))"]},{"cell_type":"code","execution_count":8,"id":"d4b5c310","metadata":{"execution":{"iopub.execute_input":"2023-02-14T05:27:52.249893Z","iopub.status.bus