ations for casual riders\n","st6 <- mydf_final_yearly_2 %>% group_by(member_casual,start_station_name) %>% summarize(count = n()) %>% arrange(member_casual,desc(count))\n","st6 <- st6 %>% mutate(cum_percent = cumsum(count)/sum(count)*100)\n","\n","ggplot(data = st6 %>% filter(member_casual == \"casual\")) + \n","  geom_bar(aes(x=reorder(start_station_name,-count), y=count), stat = \"identity\", color = \"#2B3A55\") +\n","  scale_y_continuous(limits = c(0,60000), sec.axis = sec_axis(~./600, name = \"Cumulative Percentage of Rides\"), breaks = c(0,12000,24000,36000,48000,60000)) + \n","  geom_line(aes(x=reorder(start_station_name, -count), y=cum_percent*600), group = 1, color = \"#C7BCA1\") + \n","  theme(axis.text.x = element_blank(), axis.line.y.left = element_line(color = \"black\"), axis.text.y.left = element_text(), axis.title.y.left = element_text(), axis.line.y.right = element_line(color = \"#73777B\"), axis.text.y.right = element_text(color = \"#73777B\"), axis.title.y.right = element_text(color = \"#73777B\"), text = element_text(family = \"Calibri Light\"), plot.title = element_text(hjust = 0.5)) +\n","  geom_point(aes(x= \"Western Ave & Leland Ave\", y = 80.13738*600)) +\n","  labs(title = \"Station-wise Count of Casual Rides\", x= \"Stations\", y = \"Number of Rides\") +\n","  geom_text(x = \"Western Ave & Leland Ave\", y = 80.13738*600, label = \"Point of \\n80% Rides\", size = 5, hjust = -0.2)"]},{"cell_type":"code","execution_count":9,"id":"f0baa74e","metadata":{"execution":{"iopub.execute_input":"2023-02-14T05:27:54.301661Z","iopub.status.busy":"2023-02-14T05:27:54.300084Z","iopub.status.idle":"2023-02-14T05:28:22.563753Z","shell.execute_reply":"2023-02-14T05:28:22.56055Z"},"papermill":{"duration":28.283252,"end_time":"2023-02-14T05:28:22.56739","exception":false,"start_time":"2023-02-14T05:27:54.284138","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nO