AAwSCCxAwAAABgkkNgBAAAADBL/A46k7ryZYnNQAAAAAElFTkSuQmCC"},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["#Trips based on Hour of Each Weekday\n","st10 <- mydf_final_yearly_2 %>% group_by(member_casual,weekday,hour(started_at)) %>% summarize(count = n())\n","st10 <- st10 %>% rename(hour = `hour(started_at)`)\n","st10 <- st10 %>% arrange(member_casual, weekday, desc(count))\n","st10 <- st10 %>% mutate(percent = count*100/sum(count))\n","st10 <- st10 %>% mutate(cum_percent = cumsum(percent))\n","ggplot(data = st10) +\n","  geom_histogram(aes(x=hour, y=count, group = member_casual, fill = member_casual), stat = \"identity\", position = position_dodge(preserve = \"total\")) +\n","  scale_x_continuous(breaks = seq(0,23,by=1)) +\n","  scale_y_continuous(labels = label_comma()) + \n","  facet_wrap(~weekday) +\n","  labs(y=\"Number of Rides\", x=\"Hours of the Day\") +\n","  theme(plot.title=element_text(hjust = 0.5), text = element_text(family = \"Calibri Light\"), legend.position = c(0.9,0.1), legend.background = element_blank(), panel.grid.major.y = element_line(color = \"#DDDEEE\"), panel.background = element_blank()) +\n","  scale_fill_manual(values = c(\"#00337C\",\"#F45D1A\"), name = \"Rider Type\", labels = c(\"Casual\",\"Member\"))"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":197.302611,"end_time":"2023-02-14T05:29:29.041765","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-02-14T05:26:11.739154","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}